import React from "react";
import { Form } from "antd";

const UserProfile = () => {
  return (
    <Form>
      <div>
        <label htmlFor="user-id">아이디</label>
        <br />
        <Input name="user-id" />
      </div>
      <div></div>
      <div></div>
    </Form>
  );
};

export default UserProfile;
